import React, { Component } from 'react'
import axios from 'axios';

class PostList extends Component {
     constructor(props) {
         super(props)
     
         this.state = {
              posts:[],
              error:""
         }
     }
     
     componentDidMount(){
         axios.get('https://cricapi.com/api/matches/rXH9Y3RJu3YVsF51R6FSTwLR24h2')
         .then(Response=>{
             console.log(Response.data.matches)
             this.setState({
                posts:Response.data.matches
             })
         })
         .catch(error=>{
            //console.log(error)
             this.setState({
                 error: "bahot error"
             })
         })
     }
        // axios.get('http://cricapi.com/api/cricketScore/rXH9Y3RJu3YVsF51R6FSTwLR24h2/121653?unique_id=946765')
    render() {
        const {posts,error}=this.state
        //console.log(posts)
        return (
            <div>{
                 posts.length?
                 posts.map(post=>{
                 <div key={post["unique_id"]}>{post["team-1"]}</div>
                 }):null
                }
            </div>
        )
    }
}

export default PostList
